// CCS API credentials required for  CCS API calls
var snowUserSysId = current.request.opened_by.sys_id;

var UserConfigGR = new GlideRecord('x_83068_cisco_lab_git_user_configuration');
UserConfigGR.addQuery("active", true);
UserConfigGR.addQuery("snow_user", snowUserSysId);
UserConfigGR.query();

while (UserConfigGR.next()) {
    var ccsAccountId = UserConfigGR.getValue('c3_account_id');
    var ccsApiKey = UserConfigGR.c3_api_key.getDecryptedValue();
}

workflow.scratchpad.ccs_accountId = ccsAccountId;
workflow.scratchpad.ccs_api_key = ccsApiKey;

// Get request number for deletion and if webex team exists
var requestNumber = current.variables.request_number;

var gitDeplymGR = new GlideRecord('x_83068_cisco_lab_git_deployments');
gitDeplymGR.addQuery("request_number", requestNumber);
gitDeplymGR.addQuery("active", true);
gitDeplymGR.query();

while (gitDeplymGR.next()) {
    var checkroomExists = gitDeplymGR.getValue('webex_room_active');
    var roomId = gitDeplymGR.getValue('webex_room_id');
    var jobId = gitDeplymGR.getValue('job_id');
}

var roomExists = parseInt(checkroomExists);
workflow.scratchpad.room_exists = roomExists;
workflow.scratchpad.room_id = roomId;
workflow.scratchpad.job_id = jobId;

